8 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u043d\u0430\u0434 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u044c\u044e \u0421\u0438\u0431\u0438\u0440\u0438, \u0432 \u043c\u0435\u0436\u0434\u0443\u0440\u0435\u0447\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B6%D0%BD%D1%8F%D1%8F_%D0%A2%D1%83%D0%BD%D0%B3%D1%83%D1%81%D0%BA%D0%B0\" title=\"\u041d\u0438\u0436\u043d\u044f\u044f \u0422\u0443\u043d\u0433\u0443\u0441\u043a\u0430\">\u041d\u0438\u0436\u043d\u0435\u0439 \u0422\u0443\u043d\u0433\u0443\u0441\u043a\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B0\" title=\"\u041b\u0435\u043d\u0430\">\u041b\u0435\u043d\u044b<\/a>, \u043f\u0440\u043e\u043b\u0435\u0442\u0435\u043b, \u0430 \u0437\u0430\u0442\u0435\u043c \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0441\u044f \u0433\u0438\u0433\u0430\u043d\u0442\u0441\u043a\u0438\u0439 \u0448\u0430\u0440, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BD%D0%B3%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82\" title=\"\u0422\u0443\u043d\u0433\u0443\u0441\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\">\u0422\u0443\u043d\u0433\u0443\u0441\u0441\u043a\u0438\u043c \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u0437\u0430\u043a\u043e\u043d\u0447\u0435\u043d\u0430 \u0443\u043a\u043b\u0430\u0434\u043a\u0430 \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u043e\u0433\u043e \u043a\u0430\u0431\u0435\u043b\u044f \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\">\u0415\u0432\u0440\u043e\u043f\u043e\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u042e\u0436\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%91%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0411\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u0431\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u0430 \u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u0430\u044f \u043a\u043d\u0438\u0436\u043d\u0430\u044f \u043f\u0430\u043b\u0430\u0442\u0430 (\u043d\u044b\u043d\u0435&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BD%D0%B8%D0%B6%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D0%BB%D0%B0%D1%82%D0%B0\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043d\u0438\u0436\u043d\u0430\u044f \u043f\u0430\u043b\u0430\u0442\u0430\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043d\u0438\u0436\u043d\u0430\u044f \u043f\u0430\u043b\u0430\u0442\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%B1%D1%8B_(%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA)\" title=\"\u0421\u0442\u043e\u043b\u0431\u044b (\u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a)\">\u0421\u0442\u043e\u043b\u0431\u044b<\/a>\u00bb \u043d\u0430 \u043f\u0440\u0430\u0432\u043e\u043c \u0431\u0435\u0440\u0435\u0433\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BD%D0%B8%D1%81%D0%B5%D0%B9\" title=\"\u0415\u043d\u0438\u0441\u0435\u0439\">\u0415\u043d\u0438\u0441\u0435\u044f<\/a>, \u0432\u0431\u043b\u0438\u0437\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA\" title=\"\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\">\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u0440\u0438\u0451\u043c \u0444\u043e\u0442\u043e\u0440\u0430\u0434\u0438\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a><ul><li>\u0414\u0430\u043b\u0430 \u0442\u043e\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B2%D0%B0_%D0%93%D0%AD%D0%A1-2\" title=\"\u041d\u0438\u0432\u0430 \u0413\u042d\u0421-2\">\u041d\u0438\u0432\u0441\u043a\u0430\u044f \u0413\u042d\u0421-2<\/a>, \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u0433\u0438\u0434\u0440\u043e\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u044f, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0430\u044f \u0437\u0430 \u041f\u043e\u043b\u044f\u0440\u043d\u044b\u043c \u043a\u0440\u0443\u0433\u043e\u043c.<\/li><li>\u0412 \u043d\u043e\u0447\u044c \u0441 30 \u0438\u044e\u043d\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"1 \u0438\u044e\u043b\u044f\">1 \u0438\u044e\u043b\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D1%80%D0%B5%D0%B9%D1%85\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0440\u0435\u0439\u0445\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440\">\u0413\u0438\u0442\u043b\u0435\u0440\u0430<\/a> \u043e\u0442\u0440\u044f\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1\" title=\"\u0421\u0421\">\u0421\u0421<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b\u0438 \u0432\u043d\u0435\u0437\u0430\u043f\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%87%D1%8C_%D0%B4%D0%BB%D0%B8%D0%BD%D0%BD%D1%8B%D1%85_%D0%BD%D0%BE%D0%B6%D0%B5%D0%B9\" title=\"\u041d\u043e\u0447\u044c \u0434\u043b\u0438\u043d\u043d\u044b\u0445 \u043d\u043e\u0436\u0435\u0439\">\u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435<\/a> \u043d\u0430 \u0440\u0443\u043a\u04